import './App.css';
import Header from './Components/Header';
import Footer from './Components/Footer';
function App() {
  const redSocial = 'FEISBU'
  return (
    <div>
       <Header/>
      <h1>Macalma</h1>
      <Footer
        redSocial={redSocial}
      />
    </div>
  );
}

export default App;
